fixes A B C D E :: "real*real"
assumes h0 : "A = (0, 0)"
and h1 : "B = (0, 4)"
and h2 : "D = (4, 4)"
and h3 : "E = (4, 0)"
and h4 : "area ABCDE = 40"
shows  "snd C = 16"
 proof- 
  show ?thesis sledgehammer

